description:
Movie Info: Thank You is a 2013 Malayalam drama thriller film written by Arun Lal and directed by V. K. Prakash, starring Jayasurya, Honey Rose and Sethu. The film is produced by Shahul Hameed Marikar under the banner of Marikar Films and features music composed by Bijibal, whilst cinematography is handled by Arvind Krishna and is edited by Babu Rathnam.

Credits - Splash


